import React from "react";
function Cart({title,image,price,quantity,articul}) {
  return (
    
      <tr>
        <td>
          <img src={image} alt={title} />
          <br />
          {title}</td>
        <td>{price}</td>
        <td>
          <button type='text'className='btn-minus'>-</button>
          {quantity}
          <button type='text'className='add-to-cart' data-key={articul}>+</button>
        </td>
        <td>{price*quantity}</td>
        <td>
          <button classList='btn-del' type='text'>X</button>
        </td>
      </tr>  
    
  )
}
export default Cart;
